\u0433\u0438\u0435\u0432\u0430 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044f<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%BA%D0%B0%D1%8F_%D0%BE%D1%81%D0%B0%D0%B4%D0%B0\" title=\"\u0422\u0440\u043e\u0438\u0446\u043a\u0430\u044f \u043e\u0441\u0430\u0434\u0430\">\u0422\u0440\u043e\u0438\u0446\u043a\u043e\u0439 \u043e\u0441\u0430\u0434\u044b<\/a> \u043f\u0440\u043e\u0440\u0432\u0430\u043b\u0438\u0441\u044c \u043e\u0442\u0440\u044f\u0434\u044b \u0413. \u0412\u0430\u043b\u0443\u0435\u0432\u0430 (500 \u0447\u0435\u043b.). <a href=\"https:\/\/ru.wikipedia.org\/wiki\/22_%D1%8F%D0%BD%D0%B2%D0%B0%D1%80%D1%8F\" title=\"22 \u044f\u043d\u0432\u0430\u0440\u044f\">22 \u044f\u043d\u0432\u0430\u0440\u044f<\/a> \u043e\u0441\u0430\u0434\u0430 \u0431\u044b\u043b\u0430 \u043f\u043e\u0441\u043f\u0435\u0448\u043d\u043e \u0441\u043d\u044f\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1761_%D0%B3%D0%BE%D0%B4\" title=\"1761 \u0433\u043e\u0434\">1761<\/a>&#160;\u2014 \u0432 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0438 \u0443 \u0438\u043d\u0434\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BD%D0%B8%D0%BF%D0%B0%D1%82\" title=\"\u041f\u0430\u043d\u0438\u043f\u0430\u0442\">\u041f\u0430\u043d\u0438\u043f\u0430\u0442<\/a> 90-\u0442\u044b\u0441\u044f\u0447\u043d\u043e\u0435 \u0432\u043e\u0439\u0441\u043a\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\">\u0430\u0444\u0433\u0430\u043d\u0446\u0435\u0432<\/a> (\u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%85%D0%BC%D0%B0%D0%B4-%D1%88%D0%B0%D1%85_%D0%94%D1%83%D1%80%D1%80%D0%B0%D0%BD%D0%B8\" title=\"\u0410\u0445\u043